css:
@-moz-document domain("youtube.com") {
.ytp-play-progress {
   background: url("http://i.imgur.com/LZilTpL.png") repeat-x !important; 
}

.ytp-load-progress {
   background: url("http://i.imgur.com/CKwOdWu.png") !important;
}

.html5-scrubber-button {
   background: url("http://i.imgur.com/3Q8R6NQ.png") !important;
   width: 21px !important;
   height: 21px !important;
   border: none !important;
   margin-left: -18px !important;
   margin-top: 0px !important;
}
.html5-progress-bar-container {
   height: 12px !important;
}
.html5-progress-bar {
   margin-top: 12px !important;
}
.html5-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list {
   height: 12px !important;
}
.html5-player-chrome {
   background: #000000 !important; 
}
}
